import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import notes from "../note";

function App() {
    return (
        <div>
        <Header />

        <dl className="dictionary">{notes.map((data, index) =>(
            <div className="note" key={index}>
                <dt>
                    <h1 className="">
                        {data.title}
                    </h1>
                </dt>
                <dd>
                    <p>{data.content}</p>
                </dd>
            </div>
        ))}</dl>

        <Footer />
        </div>
    )
}

export default App;
